/**
 * Set the parent object for this FormatJustifyFill object.
 * 
 * @param parentObj  A reference to the parent object of this FormatJustifyFill object.
 */
WYMeditor.editor.prototype.desktop.toolFunctions.FormatJustifyFill.setParent = function(parentObj) {
    this.parent = parentObj;
};

/**
 * Default event handler for 'blur' events on the FormatJustifyFill tool.
 */
WYMeditor.editor.prototype.desktop.toolFunctions.FormatJustifyFill.blur = function(eventObj) {
    if( (this.selfObject.parent.DEBUG != undefined) &&
        (typeof(this.selfObject.parent.DEBUG) == "boolean") &&
        this.selfObject.parent.DEBUG ) {
        console.log("The FormatJustifyFill tool detected a 'blur' event.");
        console.log(eventObj);
    }
};

